import './app.scss';
import { Row, Container, Col } from "react-bootstrap";
import personal_photo from "./assets/personal_photo.jpeg";
import git_logo from "./assets/git_logo.png";
import React from "react";


const icons = [ 
	{
		icon_image: git_logo,
		url: "https://github.com/luismomm2110",
		description: "github"
	},
];


function Photo() {
    return (
        <React.Fragment>
            <Row className="photo-box"> 
                <img src={personal_photo} style={{ "height" : "99%" , "borderRadius" : "70%"}} alt = "personal" />
            </Row>
        </React.Fragment>
    )
}

function Icons({icons}) {
	return (
		<React.Fragment>
			{icons.map(icon) }
		</React.Fragment>
	)
}

function App() {
  return (
	<Container style={{height:"100vh"}} fluid> 
		<Row>
			<Col className={"test-box"} lg={4} xs={1}>
			</Col>
			<Col  className={"test-box"} lg={4} xs={10}>
				<Photo />
				<Icons icons={icons} />
				<Row className="icon-row"></Row>
				<Row className="link-row" style={{"textAlign" : "center", "justifyContent" : "center"}}> 
				</Row>
				<Row className="link-row">
					<a href="https://github.com/luismomm2110"> Entre no meu github</a>
				</Row>
				<Row className="link-row"> </Row>
				<Row className="link-row"> </Row>
			</ Col> 
			<Col className={"test-box"} lg={4} xs={1}>
			</Col>
		</Row>
	</Container>
  );
}

export default App;
